/* 轮播图 */
.car {
    display: flex;
    justify-content: space-around;
    align-items: center;
}
.carousel{
	width: 100%;
    max-width: 1400px;
	height: 132px;
    position: relative;
    overflow: hidden;
    margin: 8px auto;
}
.carousel>ul{
	/* width: 100%; */
	height: 100px;
	position: absolute;
    padding: 0;
}
.carousel>ul>li{
    list-style: none;
	width: 280px;
	height: 100px;
    text-align: center;
	float: left;
	cursor: pointer;
    padding: 10px;
    box-sizing: border-box;
}
.carousel>ul>li .item {
    width: 100%;
    height: 100%;
    background: #fff;
    box-shadow: 0 0 10 #ccc;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
}

.car .arrow-left,
.car .arrow-right{
	width: 24px;
	height: 24px;
    border-radius: 50%;
	background: rgba(0, 0, 0, 0.05) ;
	cursor: pointer;
    z-index: 10;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-left: 24px;
}
